import styled from "styled-components";
export const CarouseWrapper = styled.div`
      width: 100%;
      height: 500px;
      position: relative;
      background-color: blue;

`;
export const PrevButton = styled.a`
      top: 50%;
      position: absolute;
      color:white;
      font-size:18px;
`;
